import React from 'react';

function RouteGraph({ route }) {
  return (
    <div>
      <h3>Graph for {route.start} to {route.end}</h3>
      <div>
        {/* Aquí iría la lógica para renderizar el grafo correspondiente */}
        {/* Por ejemplo, puedes usar una biblioteca de gráficos como d3.js o react-vis */}
      </div>
    </div>
  );
}

export default RouteGraph;
